import Link from 'next/link'
import dynamic from 'next/dynamic'

const dynamicComponent = dynamic(() => {
    import('./second').then((mod) => mod.Second)
})

function Home({posts}) {
    console.log(posts)
  return (
    <>
        <ul>
            {posts.map((ele, index) => (
                <li key={ele.id}>
                    <Link href={ele.name}>
                        <a>{ele.name}</a>
                    </Link>
                </li>
            ))}
        </ul>
        <dynamicComponent></dynamicComponent>
    </>
  )
}

export async function getStaticProps() {
    const posts = [
        {
            name: '/home/about',
            id: 1
        },
        {
            name: '/home/second',
            id: 2
        }
    ]
    return {
        props: {
            posts
        }
    }
}

export default Home
